import React from "react";
import styled from "styled-components";

export default function Field(props) {
  const component = props.component;
  const label = props.label;

  function textButton({ label }) {
    return (
      <TXButton>
        <span></span>
        <p>{label}</p>
      </TXButton>
    );
  }

  function checkComponents(component, label) {
    if (component === "text") {
      return textButton({ label });
    }
  }

  return checkComponents(component, label);
}

const TXButton = styled.div`
  border: 1px solid #e67205;
  border-radius: 20px;
`;
